import { Tabs, Radio } from "antd";

const { TabPane } = Tabs;

const data = [
  {
    key: "1",
    buildingname: "승연관",
    button: (
      <Button id="승연관" onClick={onMoreClick}>
        More
      </Button>
    )
  },
  {
    key: "2",
    buildingname: "일만관",
    button: (
      <Button id="일만관" onClick={onMoreClick}>
        More
      </Button>
    )
  },
  {
    key: "3",
    buildingname: "월당관"
  },
  {
    key: "5",
    buildingname: "나눔관"
  },
  {
    key: "6",
    buildingname: "이천환관"
  },
  {
    key: "7",
    buildingname: "새천년관"
  },
  {
    key: "9",
    buildingname: "성미가엘성당"
  },
  {
    key: "11",
    buildingname: "미가엘관"
  }
];

const BuildingList = () => {
  return (
    <>
      <Tabs defaultActiveKey="1" style={{ height: 220 }}>
        {[...Array(8).keys()].map(i => (
          <TabPane tab={`Tab-${i}`} key={i}>
            Content of tab {i}
          </TabPane>
        ))}
      </Tabs>
    </>
  );
};

export default BuildingList;
